import React, { Component } from 'react';
//import { norm, cents } from '../sound.js'

let lim5 = [
  ['256/225', '128/75', '32/25', '48/25', '36/25'],
  ['64/45', '16/15', '8/5', '6/5', '9/5'],
  ['16/9', '4/3', '1', '3/2', '9/8'],
  ['10/9', '5/3', '5/4', '15/8', '45/32'],
  ['50/36', '50/48', '25/16', '75/64', '225/128']
]

/*for (let i = -2; i < 3; i++) {
  lim5.push([])
  for (let j = -2; j < 3; j++) {
    lim5[i+2].push(norm())
  }
}


for (let i = 0; i < 6; i++) {
  for (let j = 0; j < 6; j++) {
    if (i === 0) {
      if (j === 0) {

      }
    }
  }
}*/

export default class Limit extends Component {
  /*constructor(props) {
    super(props)
  }*/

  playInterval(e) {
    console.log(e.target.innerHTML)
    play([440, 440*parseFloat(e.target.innerHTML)])
  }

  render() {
    return (
      <div className='page'>
        <div className='page__grid'>
          <div className='page__grid--empty'></div>
          <div className='page__grid--number-top'>1/9</div>
          <div className='page__grid--number-top'>1/3</div>
          <div className='page__grid--number-top'>1</div>
          <div className='page__grid--number-top'>3</div>
          <div className='page__grid--number-top'>9</div>

          <div className='page__grid--number-left'>1/25</div>
          <div className='page__grid--button'
          onClick={(e) => this.playInterval(e)}>{lim5[0][0]}</div>
          <div className='page__grid--button'>{lim5[0][1]}</div>
          <div className='page__grid--button'>{lim5[0][2]}</div>
          <div className='page__grid--button'>{lim5[0][3]}</div>
          <div className='page__grid--button'>{lim5[0][4]}</div>

          <div className='page__grid--number-left'>1/5</div>
          <div className='page__grid--button'>{lim5[1][0]}</div>
          <div className='page__grid--button'>{lim5[1][1]}</div>
          <div className='page__grid--button'>{lim5[1][2]}</div>
          <div className='page__grid--button'>{lim5[1][3]}</div>
          <div className='page__grid--button'>{lim5[1][4]}</div>

          <div className='page__grid--number-left'>1</div>
          <div className='page__grid--button'>{lim5[2][0]}</div>
          <div className='page__grid--button'>{lim5[2][1]}</div>
          <div className='page__grid--button'>{lim5[2][2]}</div>
          <div className='page__grid--button'>{lim5[2][3]}</div>
          <div className='page__grid--button'>{lim5[2][4]}</div>

          <div className='page__grid--number-left'>5</div>
          <div className='page__grid--button'>{lim5[3][0]}</div>
          <div className='page__grid--button'>{lim5[3][1]}</div>
          <div className='page__grid--button'>{lim5[3][2]}</div>
          <div className='page__grid--button'>{lim5[3][3]}</div>
          <div className='page__grid--button'>{lim5[3][4]}</div>

          <div className='page__grid--number-left'>25</div>
          <div className='page__grid--button'>{lim5[4][0]}</div>
          <div className='page__grid--button'>{lim5[4][1]}</div>
          <div className='page__grid--button'>{lim5[4][2]}</div>
          <div className='page__grid--button'>{lim5[4][3]}</div>
          <div className='page__grid--button'>{lim5[4][4]}</div>
        </div>
      </div>
    )
  }
}
